script: |
  super -f text -I q4064.spq | sort > q4064.out

inputs:
  - name: q4064.spq
    data: |
      SELECT col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( + - col2 ) NOT BETWEEN ( - col2 * + 86 - col2 ) AND + ( ( + col0 ) );
  - name: tab2

outputs:
  - name: q4064.out
    data: |
      51
      67
      77
